import React from "react";
import { Container, Row } from "./Footer.elements";
const Footer = () => {
  return (
    <Container>
      <Row>
        <img src="images/logo.svg" alt="" />{" "}
      </Row>
      <Row>
        <p>Office</p>
        <p>4 perez Drive ,</p>
        <p>Lekki Phase 1, Lagos</p>
      </Row>
      <Row>Make it Four</Row>
      <Row>Make it Four</Row>
    </Container>
  );
};

export default Footer;
